import React from "react";
import { Link } from "react-router-dom";
import video from "../../video/intro.mp4"
import s from "../LANDING-PAGE/Landingpage.module.css"

export default function LandingPage(){
    return(
        <div className={s.Landing}>
           <video id='video' autoPlay muted loop src={video} style={{position:'absolute',width:'100%',left:'50%',top:'50%',height:'100%',objectFit:'cover',transform:'translate(-50%, -50%)',zIndex:'-1'}}>
      </video>
        <Link to="/"><button>Go To Home</button></Link>
        </div>
    )
}
